import React from "react";

const Box = (props) => {
  return (
    <div className="box">
      <h1>{props}</h1>
      <img
        className="item-img"
        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS8koGHkkb04TpSTwILD3b4sew42Z6500F6Cg&usqp=CAU"
      />
      <h2>WIN</h2>
    </div>
  );
};

export default Box;
